import React, { Component } from "react";
import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";

class App extends Component {
  render() {
    return (
      <div className="App">
        <h1 className="alert alert-warning">Welcome to the project board</h1>
      </div>
    );
  }
}

export default App;
